import './Services.css';
import React, { useState, useEffect } from 'react';
import { useNavigation } from 'react-router-dom';
import axios from 'axios';
import { motion } from 'framer-motion';

function Services() {
    return (
        <div className="services">
            <motion.div
                initial={{ opacity: 0, scale: 0.7 }}
                animate={{ opacity: 1, scale: 1 }}
                exit={{ opacity: 1, scale: 0 }}
                transition={{ duration: 0.8 }}
                className="services-content"
            >
                <h1> Services </h1>
                <div className="services-list">
                    <div className="insert-experience">
                        <h2>Insert Experience</h2>
                        <div className="experience-input-ui">
                            <input type="text" placeholder="Experience URL" className="experience-input"/>
                            <button className='insert-button'>Insert</button>
                        </div>
                    </div>
                </div>
            </motion.div>
        </div>
    );
}

export default Services;
